import {
  Container,
  Row,
  Col,
  Breadcrumb,
  BreadcrumbItem,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button
} from "shards-react";
import Img from "react-image";
import LazyLoad from "react-lazyload";
import Collapsible from "react-collapsible";
import YouTube from "react-youtube";
import Countdown from "react-countdown";

// Common
import BetaMessage from "../common/BetaMessage";
import Head from "next/head";

// Layout
import Layout from "../components/Layout";

const opts = {
  height: "300px",
  width: "100%",
  playerVars: {
    autoplay: 0
  }
};

const Meetings = props => (
  <Layout>
    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Meetings</BreadcrumbItem>
      </Breadcrumb>

      <Row>
        <Col sm={12} md={8} lg={8}>
          <Card>
            <CardImg
              style={{ width: "100%" }}
              src="http://www.microsoft.com/en-us/microsoft-365/blog/wp-content/uploads/sites/2/2016/06/The-future-of-video-conferencing-1-1.png"
            />
            <CardBody>
              <CardTitle>Online Group Meetings</CardTitle>

              <br />
              <p></p>
            </CardBody>
            <CardFooter></CardFooter>
          </Card>

          <br />
          <Card>
            <CardBody>
              <CardTitle>Upcoming Meetings</CardTitle>

              <br />
              <p></p>
            </CardBody>
            <CardFooter></CardFooter>
          </Card>

          <br />
        </Col>
        <Col sm={4} md={4} lg={4}>
          <YouTube opts={opts} videoId="vFhAEoCF7jg" />
          <br />
          <YouTube opts={opts} videoId="HqncX7RE0wM" />
        </Col>
      </Row>
    </Container>
  </Layout>
);

export default Meetings;
